import React from 'react';
// import {Link} from "react-router-dom";
import {BrowserRouter as Router,Routes,Route, Link} from "react-router-dom";

import Sidebar from './component/sidebar';
import Header from './component/header';
import Footer from './component/footer';

import DeleteUserData from './pages/DeleteUserData';
import RegApprove from './pages/RegApprove';
import ViewCase from './pages/ViewCase';
import ViewDoctor from './pages/viewDoctor';
import Dashboard from './pages/Dashboard';
import ViewDoctorAssignment from './pages/viewDoctorAssignment';
import ClientMaster from './pages/clientMaster';
import AdvtMaster from './pages/advtMaster';
import AdvtMasterBottom from './pages/AdvtMasterBottom';
import WallPost from './pages/wallPost';

function App() {
  return (
    <Router>
      <div id="wrapper">
        <Sidebar/>

        <div id="content-wrapper" className="d-flex flex-column">
          <div id="content">
            <Header/>

            <Routes>
              <Route path="/dashboard" element={<Dashboard/>} />
              <Route path="/regapprove" element={<RegApprove/>} />
              <Route path="/deleteuserdata" element={<DeleteUserData/>} />
              <Route path="/viewcase" element={<ViewCase/>} />
              <Route path="/viewDoctor" element={<ViewDoctor/>} />
              <Route path="/viewDoctorAssignment" element={<ViewDoctorAssignment/>} />
              <Route path="/clientMaster" element={<ClientMaster/>} />
              <Route path="/advtMaster" element={<AdvtMaster/>} />
              <Route path="/advtmasterbottom" element={<AdvtMasterBottom/>} />
              <Route path="/wallPost" element={<WallPost/>} />
            </Routes>
          </div>

          <Footer/>
        </div>
      </div>
    </Router>
  );
}

export default App;
